css:
.react-tabs {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.react-tabs__tab-panel--selected {
  flex: 1;
  overflow: auto;
}
.github-tab {
  padding: 3px 9px;
  text-align: center;
  font-weight: 600;
  color: rgba(183, 183, 183, 0.85);
  cursor: default;
  user-select: none;
}
.github-tablist {
  flex: none;
  display: flex;
  justify-content: center;
  padding: 0;
  margin: 0;
  list-style: none;
  border-bottom: 1px solid transparent;
  background-color: #282828;
}
.github-tab-icon {
  color: rgba(93, 93, 93, 0.934);
  vertical-align: middle;
}
.github-tab-icon:before {
  margin-right: 0.4em;
}
.github-tab-count {
  display: inline-block;
  background-color: rgba(57, 57, 57, 0.9);
  border-radius: 0;
  padding: 0 0.25em;
  margin-left: 3px;
}
.github-tab.react-tabs__tab--selected {
  color: #cf5c3f;
  box-shadow: 0 1px 0 #5c6064;
}
.github-tab.react-tabs__tab--selected .github-tab-icon {
  color: rgba(255, 255, 255, 0.8);
}
